import React, { Component } from 'react';
import { Text, View, Image } from 'react-native';

class GlowText extends Component{
    state = { textColor: '#000000' };

    componentDidMount(){

        setInterval(() => (
            this.setState(() => (
                { textColor: 'rgb(' + (Math.floor(Math.random() * 256)) + ',' + (Math.floor(Math.random() * 256)) + ',' + (Math.floor(Math.random() * 256)) + ')' }
            ))
        ), 1000);
    };

    render() {
        return (
            <Text style={{ color: this.state.textColor}} >{this.props.text}</Text>
        );
    }
}

class RecipeListItem extends Component {
    render(){
        return (
            <View>
                <Text>{this.props.title}</Text>
                <Image source={this.props.image} style={{width:'50%', height: 250}} />
            </View>
        );
    }
}

export default class InteractiveRecipes extends Component {
  render() {
    let title = 'Interactive Recipes';
    let listTitle = 'Our Recipes';
    let pic = {uri: 'data:image/jpeg;base64,'}
    let chickenImg = {uri: 'https://assets.bonappetit.com/photos/5d7296eec4af4d0008ad1263/master/pass/Basically-Gojuchang-Chicken-Recipe-Wide.jpg'}

    return (
      <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
        <GlowText text={title} />
        <Image source={pic} style={{ width:'50%', height: 250 }} />
        <Text>{listTitle}</Text>
        <RecipeListItem title='Chicken' image={{chickenImg}} />
      </View>
    );
  }
}